CREATE VIEW [dbo].[TotalCostByMastersView]
AS
SELECT M.MasterFio, SUM(O.Summa) AS 'TotalCost'
FROM     dbo.Masters AS M LEFT OUTER JOIN
                  dbo.Orders AS O ON M.MasterID = O.MasterID
GROUP BY M.MasterFio
GO
/****** Object:  View [dbo].[TotalCostByMasterNotQuitedView]    Script Date: 07.02.2024 13:45:36 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[TotalCostByMasterNotQuitedView]
AS
SELECT M.MasterFio, SUM(O.Summa) AS 'TotalCost'
FROM     (SELECT MasterID, MasterFio
                  FROM      dbo.Masters
                  WHERE   (Quited = 0)) AS M LEFT OUTER JOIN
                  dbo.Orders AS O ON M.MasterID = O.MasterID
GROUP BY M.MasterFio
GO
