CREATE VIEW [dbo].[TotalCompleteOrdersView]
AS
SELECT COUNT(TypeID) AS Orders, ROUND(SUM(Summa), 2) AS Summ
FROM     dbo.Orders
WHERE  (DateStop IS NOT NULL)
