CREATE VIEW [dbo].[TotalGuarateeCompleteOrdersView]
AS
SELECT COUNT(TypeID) AS Orders, ROUND(SUM(Summa), 2) AS Summ
FROM     dbo.Orders
WHERE  (DateStop IS NOT NULL) AND (Guarantee > 0)
