CREATE VIEW [dbo].[TotalCostByCustomersView]
AS
SELECT C.CustomerFio AS [Фамилия И.О.], C.CustomerName AS Компания, SUM(O.Summa) AS TotalCost
FROM     dbo.Customers AS C LEFT OUTER JOIN
                  dbo.Orders AS O ON C.CustomerID = O.CustomerID
