GO
CREATE VIEW [dbo].[IncompleteOrdersView]
AS
SELECT O.TypeID, C.CustomerFio AS Заказчик, C.CustomerName AS Компания, O.DateStart AS [Дата Приемки], ET.EqTypeName AS Тип, E.Company AS Производство, M.MasterFio AS Мастер, O.Repaired
FROM     dbo.Orders AS O LEFT OUTER JOIN
                  dbo.Customers AS C ON O.CustomerID = C.CustomerID LEFT OUTER JOIN
                  dbo.Equipments AS E ON O.IzdelieID = E.IzdelieID LEFT OUTER JOIN
                  dbo.EquipmentType AS ET ON E.EqTypeID = ET.EqTypeID LEFT OUTER JOIN
                  dbo.Masters AS M ON O.MasterID = M.MasterID
WHERE  (O.DateStop IS NULL) OR
                  (O.Completed = 0)
